//
// Transform string interpretations of booleans into actual booleans.
// Really only need "Yes" and "No", but adding some extras for safety.
//
function str_to_bool(str) {
    switch (str) {
        case "Yes":
        case "yes":
        case "True":
        case "true":
        case "1":
        case 1:
        case true:
            return true;
        case "No":
        case "no":
        case "False":
        case "false":
        case "0":
        case 0:
        case false:
        case "":
        case null:
        default:
            return false;
    }
}

